// IMPORT EVENT
var myCodeMirror, sdbExport, cmMode;
$('#toolbar .export').on("click", function() {
	
	var content =
		'<div id="export-box">' +
			'<h2>Export.jsx</h2>' +
			'<div class="code"></div>' +
			'<div class="btns">' +
        '<div class="download btn animated fadeInDown">' +
          '<div class="icon">' +
            '<i class="fas fa-check animated"></i>' +
            '<i class="fas fa-download"></i>' +
						' <span>Download</span>' +
          '</div>' +
        '</div>' +
      '<div class="copy btn animated fadeInDown">' +
        '<div class="icon">' +
          '<i class="fas fa-check animated"></i>' +
          '<i class="fas fa-times animated"></i>' +
          '<i class="fas fa-clipboard-list"></i>' +
          '<img src="assets/images/clipboard-copy-spinner.gif" alt="">' +
					' <span>Copy to Clipboard</span>' +
        '</div>' +
      '</div>' +
      '<div class="settings btn animated fadeInDown">' +
        '<div class="icon">' +
          '<i class="fas fa-cog"></i>' +
					' <span>Settings</span>' +
        '</div>' +
      '</div>' +
      '<div class="settings-window">' +
        '<div>' +
          settings.html() +
        '</div>' +
      '</div>' +
			'</div>' +
		'</div>';
	
	modal.init( content, 'export-modal' );
	
	$('#modal-window-content').on("click", function( e ) {
		if ( $(e.target).attr('id') === 'modal-window-content' ) {
			modal.remove();
		}
	});
		
	sdbExport = getExportCode();
	cmMode = (sdbExport.language === 'javascript') ? {
		name: sdbExport.language,
		json: true
	} : sdbExport.language;
	
	/*global CodeMirror*/
	/*eslint no-undef: ["error", { "typeof": true }] */
	myCodeMirror = CodeMirror( $("#export-box .code")[0], {
		mode: cmMode,
		theme: 'monokai',
		autofocus: true,
		lineNumbers: true,
		value: sdbExport.code,
		readOnly: true
	});
	
	var exportBox = $('#export-box');
	
	// COPY TO CLIPBOARD
	exportBox.find('.btn.copy').on("click", function() {
		modal.remove(function() {
			exportToClipboard( 'export-window' ); // → legend.js
		});
	});
	
	// DOWNLOAD TO PERSONAL COMPUTER
	exportBox.find('.download').on("click", function() {
		
		/*global download*/
		/*eslint no-undef: ["error", { "typeof": true }] */
		download( sdbExport.code, sdbExport.filename, "text/" + sdbExport.language);
		
		var _this = $(this);
		var faCheck = _this.find('.fa-check');
		var faClipboard = _this.find('.fa-download');
		faCheck.addClass('rotateIn');
		faClipboard.hide();
		setTimeout(function() {
			faCheck.removeClass('rotateIn');
			faClipboard.show();
		}, 750);
		
	});

	// THIS BE THEM SETTINGS YO
  exportBox.find('.settings').on("click", function() {
    
    var settingsWindow = exportBox.find('.settings-window');
    var toggle = settingsWindow.hasClass('open') ? 'removeClass' : 'addClass';
    settingsWindow[ toggle ]('open');

  });
	
  exportBox.find('.settings-window input').on("change", function() {
    settings.toggleEvent( $(this) );
  });
	
	exportBox.find('.settings-window .setting-reference-list-dropdown .selected').on("click", function() {
    settings.referenceList( $(this) );
  });
	
	
});

function getExportCode() {
	
	// init functio is run every time an image item is created. This purges the records on every export.
	imageDuplicateCheck.images = [];
	droplist.onExport();
	
	customVar.init();
	
	var data = local_storage.get('dialog');
	
	var indentSize2 = data.settings.indentSize;
	var variableTabs = (indentSize2 ? '  ' : '    ');
	var wrapperTabsies = '';
	var tabsies = variableTabs;
	
	// SUI indents (first indentation is two spaces)
	if ( !data.settings.cepExport && data.settings.functionWrapper ) {
		wrapperTabsies = '  ';
		tabsies = wrapperTabsies + tabsies;
	}
	
	var jsxItems = getJSX( data, variableTabs, tabsies, wrapperTabsies );
	var importJSON = '\n'+ wrapperTabsies +'Code for Import https://scriptui.joonas.me — (Triple click to select): \n' + wrapperTabsies + JSON.stringify( data ) + '\n';
	
	var bundle = {};
	// HTML
  if ( data.settings.cepExport ) {
		importJSON = data.settings.importJSON ? ('<!-- ' + importJSON + '--> \n\n') : '';
		bundle.code = settings.cepExport.onExport( data, importJSON );
		bundle.language = 'htmlmixed';
		bundle.filename = 'ScriptUI Dialog Builder - Export.html';
	}
	// JAVASCRIPT
	else {
		
		bundle.code = '';
		importJSON = data.settings.importJSON ? (wrapperTabsies + '/*' + importJSON + wrapperTabsies + '*/ \n\n') : '';
		bundle.language = 'javascript';
		bundle.filename = 'ScriptUI Dialog Builder - Export.jsx';
		var aePanelGlobal = data.settings.afterEffectsDockable ? 'var panelGlobal = this;\n' : '';
		var aeDockableResize = data.settings.afterEffectsDockable ? (wrapperTabsies + customVar.names[ 0 ] +'.layout.layout(true);\n'+ wrapperTabsies + customVar.names[ 0 ] +'.layout.resize();\n'+ wrapperTabsies + customVar.names[ 0 ] +'.onResizing = '+ customVar.names[ 0 ] +'.onResize = function () { this.layout.resize(); }\n\n') : '';
		
		
		var aeShow = data.settings.afterEffectsDockable ? 'if ( '+ customVar.names[ 0 ] +' instanceof Window ) ' : '';
		var showDialog = (data.settings.showDialog ? ( wrapperTabsies + aeShow + customVar.names[ 0 ] + '.show();') : '');
		var itemReferenceList = getItemReferenceList();
		var dialogBody = jsxItems + aeDockableResize + itemReferenceList + showDialog + (data.settings.showDialog ? '\n\n' : '');
		
		if ( data.settings.functionWrapper ) {
			bundle.code += aePanelGlobal;
			bundle.code += 'var '+ customVar.names[ 0 ] +' = (function () {\n\n';
			aePanelGlobal = '';
		}
		else { aePanelGlobal = aePanelGlobal + '\n' }
		
		bundle.code += aePanelGlobal + importJSON + dialogBody;
			
		if ( data.settings.functionWrapper ) {
			bundle.code += wrapperTabsies + 'return '+ customVar.names[ 0 ] +';';
			bundle.code += '\n\n}());';
		}
		
	}
	
	return bundle;
	
	function getItemReferenceList() {
		
		var setting = data.settings.itemReferenceList.toLowerCase();
		if ( setting !== 'none' && !$.isEmptyObject( customVar.customNames ) ) {
			var list = '',
					listArray = [];
			
			list += wrapperTabsies + '// ' + 'ITEM REFERENCE LIST ( Info: http://jongware.mit.edu/Sui/index_1.html ) \n';
			list += wrapperTabsies + customVar.names[ 0 ] + '.items = { \n';
			
			var index = 0;
			var windowType = data.items['item-0'].style.windowType.toLowerCase();
			$.each( customVar.customNames, function( id, name ) {
				id = id.replace('item-', '');
				
				var lastLoop = (Object.keys( customVar.customNames ).length-1 === index);
				var targetItem = $('[data-panel="treeview"] [data-item-id="'+ id +'"]');
				list += wrapperTabsies + '  ' + name + ': ';
				var funcName = '';
				switch ( setting ) {
					case 'var':
						funcName = 'varName'
						break;
					case 'find':
						funcName = 'findElement'
						break;
					case 'path':
						funcName = 'path'
						break;
				}
				var refItem = contextMenu.get[ funcName ]( false, targetItem, 'export' );
				list += refItem + (!lastLoop ? ',' : '') + ' // ' + (id == 0 ? windowType.toLowerCase() : targetItem.data('item-type').toLowerCase() );
				listArray.push( name );
				list += '\n';
				++index;
			});
			list += wrapperTabsies + '};\n';
			list += wrapperTabsies + customVar.names[ 0 ] + '.itemsArray = [' + listArray.join(', ') + '];\n';
			
			return list + '\n';
		}
		else {
			return '';
		}
		
	}
}

function getJSX( data, variableTabs, tabsies, wrapperTabsies ) {
	
	var cornucopia = '',
			jsxParents = {},
			previousItem = {
				name: '',
				parent: ''
			},
			growTree = []; // JUST DO IT
	
	var allItems = $('#panel-tree-view-wrap .tree-dialog li');
	var itemsLength = allItems.length;
	
	allItems.each(function( i ) {
		
		
		var index      = i,
				currentId  = $(this).data().itemId,
				dataItem   = data.items[ 'item-' + currentId ],
				parentId   = dataItem.parentId,
				parentType = (parentId === 0 || parentId === false) ? 'Dialog' : data.items[ 'item-' + parentId ].type,
				type       = dataItem.type,
				id         = dataItem.id,
				style      = dataItem.style;
				
		var lastLoop = false;
		if ( i === ( itemsLength-1 ) ) {
			lastLoop = true;
		}
		cornucopia += makeJSXitem( index, data, jsxParents, type, id, parentId, parentType, style, previousItem, growTree, lastLoop, variableTabs, tabsies, wrapperTabsies );
		
	});
	
	return cornucopia;
	
}

